            <Box
              sx={{
                width: '25%',
                borderRight: '1px solid #ccc',
                backgroundColor: '#333',
                color: '#fff',
                padding: '20px',
              }}
            >
              {/* Nội dung của Sidebar */}
              <p>Sidebar Content
                <datagrid><datagrid>d</datagrid></datagrid>
              </p>
            </Box>
          </Box>
          <Grid item xs={9}>
            <Box
              sx={{
                width: '100%',
                padding: '20px',
              }}
            >
              {/* Nội dung của phần chính */}
              <p>Main Content</p>
            </Box>
          </Grid>
        </Grid>
      );
}

export default Service;
